script: |
  super -f text -I q1141.spq | sort > q1141.out

inputs:
  - name: q1141.spq
    data: |
      SELECT DISTINCT col0 AS col1 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT col1 NOT BETWEEN + col2 * - col2 AND ( 46 * col2 + + + col2 );
  - name: tab2

outputs:
  - name: q1141.out
    data: |
      46
      64
      75
